from typing import List


class GenomeReplicationAlgorithm:

    def __init__(self) -> None:
        pass

    def skew_GC(self, genome: str) -> List[int]:
        """Skew Diagram

        Skew diagram between G C nucleotides
        """

        diff = 0
        skew = [0]

        n = len(genome)
        for i in range(0, n):
            if genome[i] == 'G':
                diff += 1
                skew.append(diff)
            elif genome[i] == 'C':
                diff -= 1
                skew.append(diff)
            else:
                skew.append(diff)

        return skew

    def skew_min(self, genome: str) -> List[int]:
        """Minimum Skew

        Find the position(s) in a genome where the skew diagram attains a minimum.
        """

        skew = self.skew_GC(genome)
        mmin = min(skew)
        return [idx for idx, val in enumerate(skew) if val == mmin]

    def hamming_distance(self, p: str, q: str) -> int:

        diff = 0
        for pi, qi in zip(p, q):
            if pi != qi:
                diff += 1

        return diff

    def approximate_pattern_match(self, pattern: str, genome: str, d: int) -> List[int]:
        positions = []


        n = len(genome) - len(pattern) + 1
        k = len(pattern)

        for i in range(0, n):
            p2 = genome[i:i+k]
            if self.hamming_distance(pattern, p2) <= d:
                positions.append(i)

        return positions




